import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
  color: white;
`;

const Logo = styled.div`
  text-align: center;
  margin: 2rem 0;
  
  h1 {
    font-size: 4rem;
    margin: 0;
    font-weight: bold;
    
    span {
      color: #ff9000;
      background-color: #000;
      padding: 0.2rem 1rem;
      border-radius: 4px;
    }
  }
`;

const SearchSection = styled.div`
  text-align: center;
  margin: 3rem 0;
`;

const SearchBar = styled.input`
  width: 80%;
  max-width: 600px;
  padding: 1rem 2rem;
  border-radius: 25px;
  border: none;
  background-color: #1a1a1a;
  color: white;
  font-size: 1.2rem;
  
  &:focus {
    outline: 2px solid #ff9000;
  }
`;

const ProjectsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(280px, 1fr));
  gap: 2rem;
  margin-top: 3rem;
`;

const ProjectCard = styled.div`
  background-color: #1a1a1a;
  border-radius: 8px;
  overflow: hidden;
  transition: transform 0.2s;
  cursor: pointer;
  
  &:hover {
    transform: scale(1.02);
  }
`;

const ProjectImage = styled.img`
  width: 100%;
  height: 180px;
  object-fit: cover;
`;

const ProjectInfo = styled.div`
  padding: 1rem;
`;

const ProjectTitle = styled.h3`
  color: #ff9000;
  margin: 0 0 0.5rem 0;
`;

const ProjectStats = styled.div`
  display: flex;
  gap: 1rem;
  color: #888;
  font-size: 0.9rem;
`;

const Categories = styled.div`
  display: flex;
  gap: 1rem;
  margin: 2rem 0;
  justify-content: center;
  flex-wrap: wrap;
`;

const CategoryButton = styled.button`
  background-color: ${props => props.active ? '#ff9000' : '#1a1a1a'};
  color: ${props => props.active ? 'black' : 'white'};
  border: none;
  padding: 0.8rem 1.5rem;
  border-radius: 20px;
  cursor: pointer;
  font-weight: bold;
  
  &:hover {
    background-color: ${props => props.active ? '#ff7000' : '#252525'};
  }
`;

const Home = () => {
  const projects = [
    {
      title: "Duracell",
      image: "https://via.placeholder.com/300x200",
      views: "1.2k",
      date: "May 2024",
      category: "Java"
    },
    // Add more projects here
  ];

  return (
    <HomeContainer>
      <Logo>
        <h1><span>Lipp</span>Hub</h1>
      </Logo>
      
      <SearchSection>
        <SearchBar 
          type="text" 
          placeholder="Search projects..."
        />
        
        <Categories>
          <CategoryButton active>All</CategoryButton>
          <CategoryButton>Java</CategoryButton>
          <CategoryButton>Web</CategoryButton>
          <CategoryButton>Python</CategoryButton>
          <CategoryButton>Mobile</CategoryButton>
        </Categories>
      </SearchSection>

      <ProjectsGrid>
        {projects.map((project, index) => (
          <ProjectCard key={index}>
            <ProjectImage src={project.image} alt={project.title} />
            <ProjectInfo>
              <ProjectTitle>{project.title}</ProjectTitle>
              <ProjectStats>
                <span>👁️ {project.views}</span>
                <span>📅 {project.date}</span>
                <span>🏷️ {project.category}</span>
              </ProjectStats>
            </ProjectInfo>
          </ProjectCard>
        ))}
      </ProjectsGrid>
    </HomeContainer>
  );
};

export default Home;
